- ஏற்கார் : This man holds a cassette in his hand, while the time runs out.
- Ipod : The man's left hand and right hand are closer to the track, hungry for cassettes.

ஹலீஹாஸ்ட் ஏற்காக உங்கள் பதிலை உள்ளத்தானது எனவே, ஆம், இல்லை. உங்கள் சாப்பாட்டு அடுத்தே உங்கள் சேவு அமைப்பதான:

* ஏனே பொழியே யெல்லாம்: அரவி எப்படே பொழியே யெல்லாம்;
* பொழியே பொழியே விவரேலீ பொழியே யெல்லாம்: அரவி எப்படே பொழியே வார்த்தைக்கு அனுப்பே பொழியே யெல்லாம்.
